      out.write("//验证9-17位 的组织机构代码\r\n");
      out.write("function isValidSocialCreditIdentifier(code) {\r\n");
      out.write("\tif (code.length != 18)\r\n");
      out.write("\t\treturn false;\r\n");
      out.write("\tvar ws = [1, 3, 9, 27, 19, 26, 16, 17, 20, 29, 25, 13, 8, 24, 10, 30, 28];\r\n");
      out.write("\tvar str = \"0123456789ABCDEFGHJKLMNPQRTUWXY\";\r\n");
      out.write("\t//验证9-17位 的组织机构代码\r\n");
      out.write("\tvar tCode = code.substr(8, 8) + \"-\" + code.substr(16, 1);\r\n");
      out.write("\tif (isValidEntpCode(tCode) == false)\r\n");
      out.write("\t\treturn false;\r\n");
      out.write("\tvar sum = 0;\r\n");
      out.write("\tfor (var i = 0; i < 17; i++) {\r\n");
      out.write("\t\tsum += str.indexOf((code.substr(i, 1)) + \"\") * ws[i];\r\n");
      out.write("\t}\r\n");
      out.write("\tvar c18 = 31 - (sum%31);\r\n");
      out.write("\tif(c18 > 30){\r\n");
      out.write("\t\tc18 = 0;\r\n");
      out.write("\t} \r\n");
      out.write("\treturn (str.substr(c18, 1) + \"\") == (code.substr(17, 1));\r\n");
      out.write("}\r\n");
      out.write("function isValidEntpCode(code) {\r\n");
      out.write("\tvar ws = [3, 7, 9, 10, 5, 8, 4, 2];\r\n");
      out.write("\tvar str = \"0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZ\";\r\n");
      out.write("\tvar rx = /^([0-9A-Z]){8}-[0-9|X]$/g;\r\n");
      out.write("\tif (!rx.test(code)) {\r\n");
      out.write("\t\treturn false;\r\n");
      out.write("\t}\r\n");
      out.write("\tvar sum = 0;\r\n");
      out.write("\tfor (var i = 0; i < 8; i++) {\r\n");
      out.write("\t\tsum += str.indexOf((code.substr(i, 1)) + \"\") * ws[i];\r\n");
      out.write("\t}\r\n");
      out.write("\tvar c9 = 11 - (sum % 11);\r\n");
      out.write("\tvar sc9 = c9 + \"\";\r\n");
      out.write("\tif (11 == c9) {\r\n");
      out.write("\t\tsc9 = \"0\";\r\n");
      out.write("\t} else if (10 == c9) {\r\n");
      out.write("\t\tsc9 = \"X\";\r\n");
      out.write("\t}\r\n");
      out.write("\treturn sc9 == (code.substr(9, 1));\r\n");
      out.write("}\r\n");
